import React from 'react'
import styled from 'styled-components'
// import img from "./public/images/solar-panel.jpg"

function Section() {
    return (
        <warp style={{backgroundImage:'url(/public/images/solar-panel.jpg)'}}>
          <itemText>
            <h1>Model 1</h1>
            <p>Created by Shreyash</p>
          </itemText>

        </warp>
    )
}

export default Section
const Warp = styled.div`
  margin:15vh;
  width: 100vw;
  height: 100vh;
  background-size:cover;
  background-position:center;
  background-repeat: not-repeat;
  background-image:url('/public/images/solar-roof.jpg');
`
